function stringifyId(curId)
{
	if(curId < 0) alert("Invalid AST Identification: ID cannot be negative (Source: testData.js)");
	if(curId > 999999) alert("Invalid AST Identification: ID exceeds, but is limited to,  6 characters (Source: testData.js)");
	return ("00000" + curId).slice(-6);
}
function formatId(currentId)
{
    if(currentId < 0) alert("Invalid AST Identification: ID cannot be negative (Source: testData.js)");
    if(currentId > 999999) alert("Invalid AST Identification: ID exceeds, but is limited to,  6 characters (Source: testData.js)");
    return ("00000" + currentId).slice(-6);
}